package main

import (
	"fmt"
	"strings"
)

var input = ""

func main() {
	for i := 13; i < len(input); i++ {
		if areCharsUnique(input[i-13 : i+1]) {
			fmt.Println(i + 1)
			return
		}
	}

}

func areCharsUnique(word string) bool {
	for _, char := range word {
		if strings.Count(word, string(char)) > 1 {
			return false
		}

	}
	return true
}
